import{_ as e,c as i,o as a,aA as o}from"./chunks/framework.C8oGH8yI.js";const g=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"MAGEMinApp/partition_coef.md","filePath":"MAGEMinApp/partition_coef.md","lastUpdated":null}'),r={name:"MAGEMinApp/partition_coef.md"};function l(s,t,n,d,c,h){return a(),i("div",null,[...t[0]||(t[0]=[o('<img src="https://raw.githubusercontent.com/ComputationalThermodynamics/repositories_pictures/main/MAGEMin_doc/v1.2.1_MAGEMinApp_bulk_TE_KD.png?raw=true" alt="MAGEMinApp bulk KD" style="max-width:80%;height:auto;display:block;margin:0 auto;"><h2 id="Partition-coefficients-input-file" tabindex="-1">Partition coefficients input file <a class="header-anchor" href="#Partition-coefficients-input-file" aria-label="Permalink to &quot;Partition coefficients input file {#Partition-coefficients-input-file}&quot;">​</a></h2><p>When modelling trace-element, you have the option to provide custom sets of partition coefficients. In the <code>Setup</code> tab navigate to the <code>Phase diagram parameters</code> panel and set <code>TE predictive model = true</code>. This displays several new fields right below:</p><img src="https://raw.githubusercontent.com/ComputationalThermodynamics/repositories_pictures/main/MAGEMin_doc/v1.2.1_MAGEMinApp_bulk_TE_KD_select.png?raw=true" alt="TE KD load" style="max-width:40%;height:auto;display:block;margin:0 auto;"><h3 id="File-format" tabindex="-1">File format <a class="header-anchor" href="#File-format" aria-label="Permalink to &quot;File format {#File-format}&quot;">​</a></h3><p>The <code>Upload Kd&#39;s</code> function take an as input an excel <code>xlsx</code> file. To prepare the file, first create a <code>Sheet</code> named <code>KDs</code>. This is important as the loading routine will only look for this spreadsheet and ignores all others!</p><img src="https://raw.githubusercontent.com/ComputationalThermodynamics/repositories_pictures/main/MAGEMin_doc/v1.2.1_MAGEMinApp_bulk_TE_KD_screen.png?raw=true" alt="TE KD screen" style="max-width:70%;height:auto;display:block;margin:0 auto;"><h3 id="Spreadsheet-structure" tabindex="-1">Spreadsheet structure <a class="header-anchor" href="#Spreadsheet-structure" aria-label="Permalink to &quot;Spreadsheet structure {#Spreadsheet-structure}&quot;">​</a></h3><p>The spreadsheet must have the following structure:</p><table tabindex="0"><thead><tr><th style="text-align:right;"><code>A</code></th><th style="text-align:right;"><code>B</code></th><th style="text-align:right;"><code>C</code></th><th style="text-align:right;"><code>...</code></th><th style="text-align:right;"><code>N</code></th></tr></thead><tbody><tr><td style="text-align:right;">Acronym</td><td style="text-align:right;">Displayed name</td><td style="text-align:right;">infos</td><td style="text-align:right;">-</td><td style="text-align:right;">-</td></tr><tr><td style="text-align:right;"><code>Phase</code></td><td style="text-align:right;">El_1</td><td style="text-align:right;">El_2</td><td style="text-align:right;">...</td><td style="text-align:right;">El_n</td></tr><tr><td style="text-align:right;">Ph_1</td><td style="text-align:right;">D_El_1_Ph_1</td><td style="text-align:right;">D_El_2_Ph_1</td><td style="text-align:right;">...</td><td style="text-align:right;">D_El_n_Ph_1</td></tr><tr><td style="text-align:right;">Ph_2</td><td style="text-align:right;">D_El_1_Ph_2</td><td style="text-align:right;">D_El_2_Ph_2</td><td style="text-align:right;">...</td><td style="text-align:right;">D_El_n_Ph_2</td></tr><tr><td style="text-align:right;">...</td><td style="text-align:right;">...</td><td style="text-align:right;">...</td><td style="text-align:right;">...</td><td style="text-align:right;">...</td></tr><tr><td style="text-align:right;">Ph_m</td><td style="text-align:right;">D_El_1_Ph_m</td><td style="text-align:right;">D_El_2_Ph_m</td><td style="text-align:right;">...</td><td style="text-align:right;">D_El_n_Ph_m</td></tr></tbody></table><p>where <code>El</code> stands for element and <code>Ph</code> for phase (pure or solution)</p><div class="tip custom-block"><p class="custom-block-title">Note</p><ul><li><p>The <code>Acronym</code> should be a few characters long without spaces</p></li><li><p>The phase names must satisfy the acronym of the pure/solution phases</p></li><li><p>When using saturation models the associated phase partition coefficient should be set to 0. For instance, Zr partition coefficient for zircon (zrc) must be set to 0. This is because the stoichiometry of Zr in zircon is treated internally and does not rely on partition coefficients.</p></li><li><p>Partition coefficients can be expressions e.g., <code>&quot;0.14 * T_C/1000.0 + [:afs].compVariables[1]&quot; &quot;0.01&quot;</code>. The first entry <code>&quot;0.14 * T_C/1000.0 + [:afs].compVariables[1]&quot;</code> is a non-linear formulation of <code>Li</code> KD for <code>afs</code> that depends on temperature <code>T_C</code> and the compositional variable 1 of biotite. See MAGEMin_C output structure for more details about available parameters.</p></li></ul></div>',12)])])}const u=e(r,[["render",l]]);export{g as __pageData,u as default};
